    <script type=""text/javascript"">
        $(document).ready(function () {
            GetDropdown();

            $(""#BtnSubmit"").click(function (e) {
                e.preventDefault();
                OnSubmit();
            });
        });

        function GetDropdown() {
            $(""#ddlitems"").empty();
