            if (isCostChecked && isPriceChecked) {
                priceUpdate = 'both';
            } else if (isCostChecked) {
                priceUpdate = 'cost';
            } else if (isPriceChecked) {
                priceUpdate = 'price';
            }
            var reqPara = { Srno: srno, Value: value, IncDec: incDec, PriceType: priceType, PriceUpdate: priceUpdate }
